import React from 'react'
import { string } from 'prop-types'

import {Backpress, SearchIcon} from '../../../assets/icons'

const Icons = {
    backpress: Backpress,
    search: SearchIcon
}

const BasedIcon = ({name, ...props}) => {
    if (Icons[name] === undefined) return null;
	const Icon = Icons[name];
    return(
        <Icon style={{position: 'absolute'}} {...props} />
    )
}

BasedIcon.propTypes = {
    name: string
}

BasedIcon.defaultProps = {
    name: 'backpress'
}

export default BasedIcon
